(1,	1,	1,	0,	0,	0,	0,	'License for Contractors under provision of The Contracts Labour (R & A) Act, 1970',	2,	'20 days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'If the number of workmen proposed to be employed on contract any day\r\nLicense Fee:\r\nLess than 20 workers : Not Eligible for license\r\nFrom 20 to 50 workers - Rs.450/-\r\nFrom 51 to 100 workers – Rs.900/-\r\nFrom 101 to 200 workers - Rs.2400/-\r\nFrom 201 to 400 workers - Rs.3600/-\r\nMore than 400 workers - Rs.4500/-',	'1.Form-V issued by Principal Employer\r\n2.Application should be submitted in triplicate in FORM IV\r\n3. Copy of certification of Registration of Principal Employer',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application form IV\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate in FORM VI.',	1,	'2021-01-12 11:19:44',	1,	'2021-01-12 18:43:28',	0),
(2,	1,	1,	0,	0,	0,	0,	'Registration under Building and Other Construction Workers (RE & CS) Act, 1996 and AP Rules, 1999',	2,	'20 days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'The fees to be paid for the grant of a certificate of registration under rule 24 shall be\r\nas specified below, namely:-\r\nIf the number of workers proposed to be employed as building workers, for a\r\nbuilding or other construction work, on one dayIs up to 100: Not Eligible for license\r\nexceeds 100 but does not exceed 500 - Rs. 500/-\r\nexceeds 500– Rs. 1000/-',	'1. Application should be submitted in triplicate in Form I\r\n2. Attach a copy of work order\r\n3. Copy of Chalan',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application form I\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate in FORM II.',	1,	'2021-01-12 11:20:47',	1,	'2021-01-12 18:43:31',	0),
(3,	1,	1,	0,	0,	0,	0,	'Registration and Grant of License under the Factories Act, 1948',	2,	'20 days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'As prescribed in the schedule',	'1. Form II along with the paid challans.\r\n2.Occupancy Certificate\r\n3. Certificate regarding stability of the structure form a qualified structural engineer.\r\n.4 List of safety equipments / precautionary measures taken on site. ( on company’s\r\nletterhead and signed ).\r\n5. Machinery layout drawing architect approved.\r\n6. A copy of the approved plan.\r\n7. Provisions of Health, Safety and Welfare under the Factory Act, 1948.\r\n8. A copy of ON SITE/OFF SITE PLANS if applicable/ signed statement on company’s\r\nletterhead that it is not applicable.\r\n9. Approval of the plans from the Chief Controller of Explosives, Nagpur in respect of\r\nthe storage of Petroleum and Hazardous substances, if applicable /signed statement\r\non company’s letterhead that it is not applicable.\r\n10. Self Certification by the Management whether the premises is Owned/Leased.\r\n11. Project Report (including flow chart) (Signed).\r\n12.Copy of land document (Form I & XIV)\r\n13. A Copy of SSI Registration/Industrial Licence /In principle clearance in case of\r\nMSI/LSL.\r\n14. Details of ETP, if any, (On company letterhead and signed).\r\n15. A copy of Questionnaire duly filled and signed by the Manager and the Occupier.',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application form II\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate.',	1,	'2021-01-12 11:22:11',	1,	'2021-01-12 18:43:34',	0),
(4,	1,	1,	0,	0,	0,	0,	'Registration under the Inter State Migrant Workmen (RE & CS) Act, 1979 and AP Rules, 1982',	2,	'20 days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'If the number of migrant workmen proposed to be employed in the establishment\r\non any day-\r\n(a) is 5 but does not exceed 20:- Rs. 60/-\r\n(b) exceed 20 but does not exceed 50 :- Rs.150/-\r\n(c) exceed 50 but does not exceed 100:- Rs.300/-\r\n(d) exceed 100 but does not exceed 200 :- Rs. 600/-\r\n(e) exceed 200 but does not exceed 400:- Rs. 1200/-\r\n(f) exceed 400 :- Rs. 1500/-',	'1. Application should be submitted in Triplicate FORM I',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application FORM I\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate.',	1,	'2021-01-12 11:23:06',	1,	'2021-01-12 18:43:37',	0),
(5,	1,	1,	0,	0,	0,	0,	'Registration under Shop & Establishment Act, 1988',	2,	'15 days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'If the number of workmen proposed to be employed on contract on any day –\r\n\r\n(a) employing no persons :- Rs. 20/-\r\n(b) employing 5 or less than five persons:- Rs. 40/-\r\n(c) employing more than five but less than 10 persons :- Rs. 150/-\r\n(d) employing 10 and above but less than 20 persons :- Rs. 300/-\r\n(e) For Hotels :- Rs. 600/-',	'1. Application in Form I\r\n2. Lease Agreement / Ownership documents\r\n3. Fees / Copy of Challan\r\n4. Copy of house taxes issue by the Panchayat or DMC\r\n5. Photo of Shop\r\n6. Aadhar Card\r\n7. Pan Card\r\n8. GST',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application FORM I\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate in FORM II.',	1,	'2021-01-12 11:24:05',	1,	'2021-01-12 18:43:40',	0),
(6,	1,	1,	0,	0,	0,	0,	'Factory Plan approval under Factories Act, 1948',	1,	'15 Days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'',	'1. Two sets of Factory building drawings showing the plans, Elevations Crosssections, the location of site (duly signed by the Occupier and the Architect) and\r\nits surroundings along with Form no. 1.\r\n2. Copy of Provisional registration –SSI / in principle clearance letter for MSI / LSI.\r\n(Not applicable for gala construction).\r\n3. Project Report giving the list of machineries, flow process, manufacturing\r\nProcess, raw materials, finished products and bye / intermediate products. (Not\r\nApplicable for gala construction).\r\n4. Quantity and mode of storage of LPG, Petroleum fuels, hazardous substances,\r\nif any / signed statement on company’s letter head that it is not applicable (Not\r\nApplicable for gala construction).\r\n5. Position and the drawing of the Effluent Treatment Plant, if any / signed\r\nstatement on company’s letter head that it is not applicable (Not applicable for\r\nGala construction).\r\n6. Machinery lay out in the building drawings along with their respective power\r\nRating (Not applicable for gala construction).\r\n7. A copy of Questionnaire.',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application FORM I\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate.',	1,	'2021-01-12 11:25:27',	1,	'2021-01-12 18:43:43',	0),
(7,	1,	1,	0,	0,	0,	0,	'Boiler Registration',	3,	'30 Days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'As per annexure 1',	'1. Application on Company Letter head\r\n2. Fees as per the schedule\r\n3. Plans of Pipeline\r\n4. Original Document of Boiler',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application FORM I\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate',	1,	'2021-01-12 11:26:22',	1,	'2021-01-12 18:43:45',	0),
(8,	1,	1,	0,	0,	0,	0,	'Renewal for Boiler Registration',	4,	'15 Days',	'Labour Enforcement Officer',	'Asst Labour Commissioner',	'Secretary',	'',	'As per annexure 1',	'1. Application on Company Letter head\r\n2. Fees as per the schedule\r\n3. A copy of last Boiler License',	'1. Visit Single Desk Portal & register\r\n2. Fill in the application\r\n3. Pay the fees along with security deposit online\r\n4. Approval by the Authority.\r\n5. Download the Certificate.',	1,	'2021-01-12 11:30:50',	1,	'2021-01-12 18:43:47',	0),
(9,	1,	13,	0,	0,	0,	0,	'Provisional Fire-No Objection Certificate',	1,	'30 Days',	'Department of Home - Fire & Emergency Services',	'',	'',	'',	'Rs.10/- per sq. meter on total Built up area (Including Basement).\r\nVisit PFMS Challal Creation >> The Chief of Police (H.O. of Fire &\r\nEmergency Deptt.) Nani Daman [209703] >> Fire Protection &\r\nControl (0070601090000) >> Pay and Accounts Office Daman\r\n[008998]',	'The following documents shall be enclosed in the Industrial\r\nbuilding:\r\n(i) Application form dully filled in all respect\r\n(i) Self declaration on plain paper and Photo ID proof (i.e. Aadhar\r\nCard, Election Card, Passport etc…). (ii) Site plan of land issued by Enquiry Officer, City Survey\r\nDepartment, Daman.\r\n(iii) 1 & XIV Nakal of the land issued by Talathi (Mamlatdar\r\nDepartment)\r\n(iv) Proposed Plan (i.e Layout plan, floor wise plan, section and\r\nelevation plan with area statement)\r\n(v) Project Report of the Industries',	'Step- 1\r\na) The applicant shall open the above Online Single Window\r\nPortal using the address\r\nb) Online Services >> Click on >> Provisional NOC\r\nc) After fill the details than (Click Here to verify) e-mail sent to\r\nregister e-mail.\r\nd) After receiving e-mail to start the application form, after filled\r\napplication form than (Click on Confirm & Submit) to upload\r\ndocuments as per check list\r\nStep - 2\r\nThe following documents (Scanned Copies in .pdf format) are\r\nrequired to be uploaded.\r\n(i) Application form dully filled in all respect\r\n(i) Self declaration on plain paper and Photo ID proof (i.e. Aadhar\r\nCard, Election Card, Passport etc…).\r\n(ii) Site plan of land issued by Enquiry Officer, City Survey\r\nDepartment, Daman.\r\n(iii) 1 & XIV Nakal of the land issued by Talathi (Mamlatdar\r\nDepartment)\r\n(iv) Proposed Plan (i.e Layout plan, floor wise plan, section and\r\nelevation plan with area statement)\r\n(v) Project Report of the Industries\r\nStep – 3\r\nAfter upload all documents, submit the application in online single\r\nwindow system\r\nStep – 4\r\nOnce the application is submitted it appears in the Dashboard of the\r\nDealing Hand and application forwarded to Assistant Director.\r\nStep – 5\r\nAssistant Director forwarded to Station Fire Officer for Examine/\r\nScrutiny of the building plan and other relevant documents of the\r\nproposed building. Step – 6\r\nThe Station Fire Officers put the file for approval of Director\r\nthrough Assistant Director for approval\r\nStep – 7\r\nAfter obtain approval from Director of Fire & Emergency Services,\r\nDaman & Diu, Daman, the applicant shall have to pay fee in the bank\r\nthrough challan for fire NOC as per 10/- per sq.m. built up area of\r\nthe occupancy as per Notification dated 09-05-2016.',	1,	'2021-01-27 11:36:47',	0,	'0000-00-00 00:00:00',	0),
(10,	1,	3,	2,	9,	3,	10,	'Property Registration under provision of the Indian Registration Act, 1908',	1,	'Same Day',	'Sub Registrar',	'Jt./Deputy Secretary Revenue',	'Collector / Registrar',	'',	'In exercise of the powers conferred by Section-78 of the Indian Registration Act, 1908\r\n(XVI of 1908), the Administrator of Union Territory of Daman and Diu hereby reduces\r\nthe Registration Fees by 0% for females and by 0.25% in respect of joint registration for\r\nmale and female, when the following notified / mentioned instruments are executed in\r\nfavour of women buyers or in the joint name of the male and female buyers respectively,\r\nin the Union Territory of Daman and Diu.',	'(1) Passport Size Original Photographs of all Parties from vendor side as well as from purchaser\r\nside and if power of attorney holder then its too (2 Nos. Each)\r\n(2) Identity proof of all parties from vendor side as well as from purchaser side.\r\n(3) Copy of PAN card / Form 60 of all parties from vendor side as well as from purchaser side\r\nand of company / organization.\r\n(4) Identity proof of identifying witnesses (local residence) as well as normal witnesses (local\r\nResidence)\r\n(5) If documents executed through its power of attorney holder than copy of registered power\r\nof attorney holder should be attached.\r\n(6) Copy of Sale permission order in respect of land issued by the Hon’ble Collector, Daman.\r\n(7) Copy of NA Sanad in respect of N. A. Land.\r\n(8) Copy of fresh I & XIV NAKAL\r\n(9) Copy of Completion/Occupation Certificate of Building in respect of constructed properties\r\nis mandatory.\r\n(10)If Sale Deed made for a part property then copy site plan clearly showing the location / area\r\nfor sale is required.',	'Step 1 : Applicant / Party has to represent documents of property registration along with other\r\nrequisite documents like Aadhar & Pan Card of vendor and purchaser and other related documents.\r\nStep 2 : The registering officer verifies / examines the documents submitted by the vendor and\r\nsatisfy himself that the persons appearing before him are the persons they represent themselves to\r\nbe.\r\nStep 3 : Calculation of Stamp Duty as per the circle rate and also calculation of the registration fees,\r\nas per applicability.\r\nStep 4 : Generation of receipt of Registration Fees and payment of Registration Fees through Debit\r\n/ Credit cards / DD.\r\nStep 5 : Bio-metric capturing of photos and thumb impression of party, identifier and witnesses\r\nand preparation of endorsement.\r\nStep 6 : Signature of parties on endorsement and documents.\r\nStep 7 : Scanning of documents and uploading on the server/ local\r\n machine\r\n.\r\nStep 8 : Registration of Transaction Deed is provided to related party',	1,	'2021-01-27 11:53:48',	1,	'2021-01-28 19:45:41',	0),
(11,	1,	37,	0,	0,	0,	0,	'Obtaining Plinth Level Certificate from PDA',	2,	'07 Days',	'Member Secretary (PDA)',	'Chairman (PDA)',	'',	'https://swp.dddgov.in/',	'NA',	'1. Application submitted form for Plinth Level\r\nCertificate as per Annexure-11.\r\n2. Certified copy of Construction License and\r\n Approved Building plan.\r\n3. Notice for Commencement of Work\r\n (Annexure – 9) from the applicant',	'1. The Owner/Authorised person shall submit\r\ntheir proposals through registered\r\nprofessionals.\r\n2. The details/documents shall entry/ upload on\r\nthe said website.\r\n3. After scrutiny of the documents, query may\r\nbe raised.\r\n4. After sorting out the query by the applicant by\r\nuploading required documents etc., the said\r\ndocuments shall be scrutinised and proposal\r\nshall be processed accordingly.\r\n5. Plinth Level Certificate shall be provided to\r\nthe applicant.',	1,	'2021-01-27 11:55:42',	1,	'2021-02-12 15:59:35',	0),
(12,	1,	37,	0,	0,	0,	0,	'New Building Plan Approval from PDA',	1,	'25 days',	'Member Secretary (PDA)',	'Chairman (PDA)',	'',	'https://swp.dddgov.in/',	'1. Scrutiny fees (By ATM card or by cheque)\r\n(mandatory – to be submitted at the time of\r\napplication)\r\nAmount of scrutiny fees for plot area\r\n upto 1000 sqmt :- Rs. 500/-\r\n 1001 sqm to 2000sqm :- Rs.1000/-\r\n More than 2000sqm:- Rs. 1 per sqm.\r\n2. Labour cess @1% of Cost estimate through\r\nDD in the name of Daman & Diu Building &\r\nConstruction Worker Welfare Fund payable\r\nat Daman.(DD to be submitted after approval\r\nof draft licence)',	'1. Annexure III, IV and Annexure V (Mandatory)\r\n(Annexure V is required if the building is High\r\nRise Building)\r\n2. Copy of N.A. Sanad /Order/ Property card for\r\nexisting Gaothan area. (Mandatory)\r\n3. Original certified Map of Survey/Plot no.\r\nissued by City Survey office, Daman (latest\r\noriginal) (Mandatory)\r\n4. I and XIV nakal (Latest original) (Mandatory)\r\n5. Building Plan with complete details as per\r\nRule 6.7 to 6.12 of DCR 2005 (Building plan\r\nshall also include Key Plan/Location plan, site\r\nplan and service plan.) (Mandatory)\r\n6. Cost Estimate for the proposed building from\r\nthe Registered Architect/engineer.\r\n(Mandatory)\r\n7. Scrutiny fees (By ATM card or by cheque)\r\n(mandatory – to be submitted at the time of\r\napplication)\r\nAmount of scrutiny fees for plot area\r\nupto 1000 sqmt –Rs. 500/-\r\n1001 sqm to 2000sqm Rs.1000/-\r\nMore than 2000sqm Rs. 1 per sqm.\r\n8. NOC of the coast Guard Authority for Height\r\nRestriction/ Receive copy of application made\r\nfor issuance of NOC to Coast Guard Authority\r\n(Mandatory).\r\n9. Provisional NOC from Fire Department\r\n(Applicable to all building except Residential\r\nbuilding having height less than 15m)\r\n10. CRZ clearance certificate of the concerned\r\nauthority (This is required in case of land\r\nfalling under CRZ).\r\n11. True copy of approved layout plan and Sub\r\ndivision order (This is applicable if land is part\r\nof private Industrial Estate/ Private sub\r\ndivision.)\r\n12. Copy of the amalgamation order, if relevant.\r\n13. If application is for revised plan/additional and\r\nalteration to the existing building, then true\r\ncopy of the construction permission along\r\nwith approved plan and Occupancy Certificate\r\nis required.\r\n14. Certificate or order of the Land Acquisition\r\nOfficer if claiming benefit of additional FSI in\r\nlieu of compensation (If applicable)\r\n15. Labour cess @1% of Cost estimate through\r\nDD in the name of Daman & Diu Building &\r\nConstruction Worker Welfare Fund payable at\r\nDaman.(DD to be submitted after approval of\r\ndraft licence)',	'1. The Owner/Authorised person shall submit\r\ntheir proposals through registered\r\nprofessionals.\r\n2. The details/documents shall entry/ upload\r\nalong with initial scrutiny fees on the said\r\nwebsite.\r\n3. After scrutiny of the documents, query may\r\nbe raised.\r\n4. After sorting out the query by the applicant by\r\nuploading required documents etc., the said\r\ndocuments shall be scrutinised and proposal\r\nshall be processed accordingly.\r\n5. Applicant has to then submit labour cess\r\n@1% of Cost estimate through DD in the\r\nname of Daman & Diu Building &\r\nConstruction Worker Welfare Fund payable at\r\nDaman.\r\n6. After submission of labour cess, Final\r\nLicense and',	1,	'2021-01-27 11:56:50',	1,	'2021-02-12 15:57:09',	0),
