(18,	1,	3,	2,	9,	3,	10,	'Partnership / Firm Registration under provision of the Indian Partnership Act ,1932',	2,	'15 Day',	'Sub Registrar',	'Jt./Deputy Secretary Revenue',	'Collector / Registrar',	'',	'SCHEDULE OF FEES AS PER INDIAN PARTNERSHIP ACT ,1932',	'1) Application on company\'s letter head with rubber stamp.\r\n2) Prescribed form to filled (FORM NO. II).\r\n3) Copy of Self Attested Partnership Deed which shall be registered by Sub Registrar Office /\r\nPublic Notary Subject to verification of original Documents / Partnership Deed.\r\n4) Aadhar Card of Parties.\r\n5) Pan Card of Firms/ Pan of Partners\r\n6) Admission / Retirement Form',	'Step 1 : Applicants / Parties has to apply for registration to Sub\r\n Registrar office in Form No. II as prescribed under Section 58\r\n and Rule 7 (2) of The Indian Partnership\r\n Act, 1932 along with Partnership Deed.\r\nStep 2 : Sub-Registrar examines the application.\r\nStep 3 : Upon satisfaction of Registrar that the provisions of Section 58\r\n have been duly complied, shall record an entry of the\r\n statement in a register.\r\nStep 4 : Payment of fees of an amount of Rs. 100/- by the applicants /\r\n parties.\r\nStep 5 : Issue of Partnership Firm Registration certificate',	1,	'2021-01-28 19:46:56',	1,	'2021-01-28 19:47:36',	0),
(19,	0,	0,	0,	0,	3,	16,	'Signage License for Advertisement (Advertisement Permission)',	1,	'15 Days',	'Chief Officer, Silvassa Municipal Council',	'',	'',	'https://smcdnh.in/',	'Click here to Download Fees Details.\r\n\r\n<a target=\"_blank\" href=\"https://swp.dddgov.in/assets/department/dic/advertisement-permission-fees-details.pdf\" >Download Fees Details</a>',	'- Application form available in SMC Office or can\r\nbe submitted online on website\r\n(http://smcdnh.in/).\r\n- NOC from concern Owner from Private Property,\r\nif applicable.\r\n- Structure stability certificate\r\n- Photo copy of advertisement.\r\n- Email ID & Mobile Number.',	'Online procedure:-\r\n- Online application is submitted at\r\nhttp://smcdnh.in/ and attached all required\r\ndocuments like NOC, Structure stability\r\ncertificate and Photo copy of advertisement and\r\nsubmitted the fee through online payment mode.\r\n- Then the application will be scrutinized by\r\nconcerned DEO. After scrutiny the DEO will\r\nforward the application to concerned Junior\r\nEngineer for site inspection (4 days).\r\n- The Junior Engineer after inspection will submit\r\nthe site report signed by concern AE to DEO (3\r\ndays).\r\n- The DEO after receiving site report will generate\r\ndemand for payment of advertisement tax (2\r\ndays).\r\n- After payment of demand by the applicant the\r\napplication is forwarded to Administrative Officer\r\nthrough Accountant for approval (4 days).\r\n- After approval the permission order is issued to\r\napplicant (2 days).\r\nManual procedure:-\r\n- Application form available at\r\nhttp://smcdnh.nic.in/ can be submitted online\r\nthrough smctimeboundservices@gmail.com or at\r\nSingle Window of SMC with necessary fees.\r\n- Application is then forwarded to DEO for scrutiny.\r\nAfter scrutiny, the application is send to Junior\r\nEngineer for site inspection (4 days).\r\n- After receiving the site report from Junior\r\nEngineer signed by concerned AE, the demand\r\nletter is prepared by DEO (3 days).\r\n- After receiving advertisement tax from applicant\r\n(2 days).\r\n- The application is then forwarded to\r\nAdministrative Officer through Accountant for\r\napproval (4 days).\r\n- After getting the approval from Administrative\r\nOfficer, the permission order is prepared by DEO\r\nand issued to applicant (2 days).',	1,	'2021-02-03 17:21:02',	1,	'2021-02-03 17:34:31',	0),
(20,	1,	40,	2,	46,	3,	47,	'New Hotel Registration',	5,	'21 Days',	'Director (Tourism), DNH & DD',	'',	'',	'https://swp.dddgov.in/login#hotelregi',	'1. Rs. 5000/- (Category A)\r\n2. Rs. 4000/-\r\n(Category B)\r\n3. Rs. 3000/-\r\n(Category C)\r\n4. Rs. 2000/-\r\n(Category D)\r\n5. Rs. 200/-\r\n(Category E/Homestay or Bed & Breakfast)\r\nMode of Payment: Demand draft',	'Required Documents / undertakings / NOCs :\r\n1. Copy of Form 1 & XIV\r\n2. Copy of the site plan\r\n3. Copy of the approved construction plan\r\n4. Copy of the Occupancy certificate (Issued by Municipality or concerned panchayat)\r\n5. Copy of grant of the final NOC of Fire Department (issued by Fire and Emergency\r\ndepartment)\r\n6. Health NOC (Issued by Health Department)\r\n7. Police clearance certificate (issued by SDPO)\r\n8. NOC from concerned Panchayat/Municipality.\r\n9. NOC from Electricity Department.',	'Step 1. The applicant submits the application in the prescribed format to the\r\ndepartment with all the necessary documents.\r\nStep 2. The authority examines the application and the documents.\r\n Step 3. Site inspection of the proposed site for the hotel is scheduled.\r\nStep 4. The authority verifies the details provided in the application and the\r\nproposed site plan.\r\nStep 5. If approved, the license for operating the hotel/homestay or Bed & Breakfast\r\nis issued.',	1,	'2021-02-12 13:56:51',	0,	'0000-00-00 00:00:00',	0),
(21,	1,	40,	2,	46,	3,	47,	'New Homestay / Bed  & Breakfast Registration',	5,	'21 Days',	'Director (Tourism), DNH & DD',	'',	'',	'',	'Fees: 1. Rs. 200/-\r\n(Category E Hotel/Homestay or Bed & Breakfast)\r\nMode of Payment: Demand draft',	'Required documents:\r\n1. Copy of Aadhar Card of the person under whose name the Bed & Breakfast\r\n/Homestay is to be registered.\r\n2. Copy of the Form No. 1 & XIV of survey No.\r\n3. Copy of the site plan of survey no.\r\n4. Copy of the NA order of Survey no (*if the property falls under agriculture\r\narea/panchayat) (Issued by the DMC/Concerned Panchayat)\r\n5. Copy of Completion/occupancy certificate (Issued by the DMC/Concerned\r\nPanchayat)\r\n6. Copy of House Tax receipt\r\n7. Copy of Electricity bill\r\n8. Copy of Fire NOC (issued by Fire and Emergency department)\r\n9. Copy of Police Clearance certificate (issued by SDPO)',	'Step 1. The applicant submits the application in the prescribed format to the\r\ndepartment with all the necessary documents.\r\nStep 2. The authority examines the application and the documents.\r\nStep 3. Site inspection of the proposed site for the hotel is scheduled.\r\nStep 4. The authority verifies the details provided in the application and the proposed\r\nsite plan.\r\nStep 5. If approved, the license for operating the homestay or Bed & Breakfast is\r\nissued',	1,	'2021-02-12 14:32:05',	0,	'0000-00-00 00:00:00',	0);

DROP TABLE IF EXISTS `shop`;
CREATE TABLE `shop` (
  `s_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `s_registration_no` varchar(100) NOT NULL,
  `district` tinyint(1) NOT NULL,
  `s_name` varchar(100) NOT NULL,
  `s_door_no` varchar(25) NOT NULL,
  `s_street_name` varchar(100) NOT NULL,
  `s_location` text NOT NULL,
  `s_postal_address` text NOT NULL,
  `s_different_location` tinyint(1) NOT NULL,
  `s_different_location_office` varchar(100) NOT NULL,
  `s_different_location_store_room` varchar(100) NOT NULL,
  `s_different_location_godown` varchar(100) NOT NULL,
  `s_different_location_warehouse` varchar(100) NOT NULL,
  `s_employer_name` varchar(100) NOT NULL,
  `s_employer_mobile_no` varchar(10) NOT NULL,
  `s_employer_residential_address` text NOT NULL,
  `s_manager_name` varchar(100) NOT NULL,
  `s_manager_residential_address` text NOT NULL,
  `s_partners_name` varchar(100) NOT NULL,
  `s_partners_residential_address` text NOT NULL,
  `s_category` varchar(100) NOT NULL,
  `s_nature_of_business` varchar(100) NOT NULL,
  `s_commencement_of_business_date` date NOT NULL,
  `s_employers_family_details` text NOT NULL,
  `s_employees_details` text NOT NULL,
  `s_name_of_treasury` varchar(100) NOT NULL,
  `challan` varchar(100) NOT NULL,
  `challan_updated_date` datetime NOT NULL,
  `fees_paid_challan` varchar(100) NOT NULL,
  `fees_paid_challan_updated_date` datetime NOT NULL,
  `lease_agreement_document` varchar(100) NOT NULL,
  `house_tax_copy` varchar(100) NOT NULL,
  `photo_of_shop` varchar(100) NOT NULL,
  `aadhar_card` varchar(100) NOT NULL,
  `pan_card` varchar(100) NOT NULL,
  `gst` varchar(100) NOT NULL,
  `s_sign_of_employer` varchar(50) NOT NULL,
  `s_declaration` tinyint(1) NOT NULL,
  `s_certificate_expiry_date` date NOT NULL,
  `s_remark` text NOT NULL,
  `submitted_datetime` datetime NOT NULL,
  `processing_days` int(11) NOT NULL,
  `payment_type` tinyint(1) NOT NULL,
  `user_payment_type` tinyint(1) NOT NULL,
  `query_status` tinyint(1) NOT NULL,
  `status` tinyint(1) NOT NULL,
  `status_datetime` datetime NOT NULL,
  `created_by` int(11) NOT NULL,
  `created_time` datetime NOT NULL,
  `updated_by` int(11) NOT NULL,
  `updated_time` datetime NOT NULL,
  `is_delete` tinyint(1) NOT NULL,
  PRIMARY KEY (`s_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

